import pic from '../Media/young-tender-curly-girl-holding-documents.png'
import React, { useRef, useState } from 'react';
import Box from '@mui/material/Box';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import Button from '@mui/material/Button';
import styled from '@emotion/styled';
import axios from 'axios';
import { Container, StepButton, Typography } from '@mui/material';

const steps = ['Personal Information', 'Career Information', 'Preferences'];

export default function FormPage() {
    const [name, setName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phone, setPhone] = useState('');
    const [password, setPassword] = useState('');
    const [age, setAge] = useState('');
    const [recoveryEmail, setRecoveryEmail] = useState('');
    const [selectedGender, setselectedGender] = useState('');
    const [city_id,setCity_id]=useState("")
    const [cities,setcities] = useState([])
    const [gender,setgender] = useState(['female','male'])
    const windowHeight = useRef(window.innerHeight);
    const [activeStep, setActiveStep] = React.useState(0);
    const [skipped, setSkipped] = React.useState(new Set());
    const [completed, setCompleted] = React.useState({});

    const [sendingImage, setSendingImage] = useState('');
    const [imagee, setImagee] = useState('');
    const [comment,setComment]=useState('')
    const [interest,setInterest]=useState('')
  
    const StyledStepIcon = styled.div`
      width: 30px;
      height: 30px;
      border-radius: 50%;
      color: white;
      background-color: ${props => props.active ? '#7D4896' : '#ccc'};
      display: flex;
      flex-wrap:wrap;
      align-items: center;
      justify-content: center;
    `;
  
    const isStepSkipped = (step) => {
      return skipped.has(step);
    };

    const handleNext = () => {
      let newSkipped = skipped;
      if (isStepSkipped(activeStep)) {
        newSkipped = new Set(newSkipped.values());
        newSkipped.delete(activeStep);
      }
      setActiveStep((prevActiveStep) => prevActiveStep + 1);
      setSkipped(newSkipped);
    };

    const handleBack = () => {
      setActiveStep((prevActiveStep) => prevActiveStep - 1);
    };
  
    const handleFinish =() =>{
    //   const formData = new FormData();
    //   formData.append('firstname', name);
    //   formData.append('lastname', lastName);
    //   formData.append('age', age);
    //   formData.append('gender', gender);
    //   formData.append('email', recoveryEmail);
    //   formData.append('phone', phone);
    //   formData.append('password', password);
    //   formData.append('avatar', name);
    //   formData.append('nationality', city_id);
    //   formData.append('interests', interest);
    //   for (var pair of formData.entries()) {
    //     console.log(pair[0]+ ', ' + pair[1]); 
    // }
    // axios.post(`${process.env.REACT_APP_API_URL}register`,formData).then(res=>{
    //   console.log(res.data)
    // })
    }

  return (
    <div style={{marginTop:'90px'}}>
      <img src={pic} style={{width:'100%',height:'500px',objectFit:'cover'}}/>
      <div>
        <Container maxWidth='sm' sx={{ alignItems: 'center', justifyContent: 'center'}}>
        <Typography sx={{fontSize:'30px',color:'black',marginTop:'50px'}}>
        Become a Tutor
        </Typography>
        <br/>
        <Typography sx={{fontSize:'16px',color:'black'}}>
        Kindly fill the following form so we can get an idea of your experience, qualifications, and better sort you into the best fit for a greater teaching experience!
        </Typography>
        </Container>
      </div>
      <div style={{ width: '100%',
     alignItems: 'start', justifyContent: 'center', 
     display: 'flex'}}>
      <Box sx={{ width: '70%' ,padding:"40px"}}>
      <Stepper nonLinear activeStep={activeStep}>
        {steps.map((label, index) => {
        const labelProps = {};
        return (
          <Step key={label} completed={completed[index]} >
         <StepLabel
  {...labelProps}
  StepIconComponent={(stepIconProps) => (
    <StyledStepIcon active={stepIconProps.active}>
      {stepIconProps.icon}
    </StyledStepIcon>
  )}
>
  {label}
</StepLabel>
          </Step>)
        })}
      </Stepper>
        {activeStep === steps.length ? (
          <div>hello</div>
        ) : (
          <React.Fragment>
              {activeStep === 0 && (
                <div style={{ padding:'20px' }}>
               hi
                </div>
            )}
              {activeStep === 1 && (
                <div>
                hi
                </div>
            )}
               {activeStep === 2 && (
                'hhh'
            )}
            <Box sx={{ display: 'flex', flexDirection: 'row' }}>
              <Button
                color="inherit"
                disabled={activeStep === 0}
                onClick={handleBack}
                sx={{ mr: 1, color:'#DD560A' }}
              >
                Back
              </Button>
              <Box sx={{ flex: '1 1 auto' }} />
             {activeStep !== steps.length - 1 ? 
             <Button onClick={handleNext} sx={{ color:'#DD560A' }}>
                Next
              </Button> : 
              <Button onClick={handleFinish} sx={{ color:'#DD560A' }}>
                Finish
              </Button>}
            </Box>
          </React.Fragment>
        )}
      </Box>
    </div>
    </div>
  )
}
